`,paraId:79,tocIndex:27},{value:"\u4F7F\u7528 fork \u521B\u5EFA\u4E00\u4E2A\u5B50\u8FDB\u7A0B\u5B9E\u4F8B\uFF0C\u901A\u8FC7\u8FD9\u4E2A\u5B9E\u4F8B\u53EF\u4EE5\u76D1\u542C\u6765\u81EA\u5B50\u8FDB\u7A0B\u7684\u6D88\u606F(worker.on)\u6216\u8005\u5411\u5B50\u8FDB\u7A0B\u53D1\u9001\u6D88\u606F(worker.send)\u3002worker \u8FDB\u7A0B\u5219\u901A\u8FC7 process \u5BF9\u8C61\u63A5\u53E3\u76D1\u542C\u6765\u81EA\u7236\u8FDB\u7A0B\u7684\u6D88\u606F(process.on)\u6216\u8005\u5411\u7236\u8FDB\u7A0B\u53D1\u9001\u6D88\u606F(process.send)",paraId:80,tocIndex:28},{value:`// master.js
const childProcess = require('child_process');
